import React from "react";

export default function UserNavHeader() {
  return (
    <div>
      <div className="items-center flex-shrink-0 hidden lg:flex">
        <div className="inline-flex items-center border-r-1 pr-3">
          <svg
            style={{ width: 30, marginRight: 5 }}
            focusable="false"
            viewBox="0 0 24 24"
            aria-hidden="true"
          >
            <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 3c1.66 0 3 1.34 3 3s-1.34 3-3 3-3-1.34-3-3 1.34-3 3-3zm0 14.2c-2.5 0-4.71-1.28-6-3.22.03-1.99 4-3.08 6-3.08 1.99 0 5.97 1.09 6 3.08-1.29 1.94-3.5 3.22-6 3.22z"></path>
          </svg>
          <div>
            <button className="text-base font-semibold">Đăng Nhập</button>
          </div>
        </div>
        <button className="text-base font-semibold pl-3">Đăng Ký</button>
      </div>
    </div>
  );
}
